class Solution:
    def minimumCost1(self, N: int, conections) -> int:
        f = {}
        def find(x):
            f.setdefault(x, x)
            if f[x] != x:
                f[x] = find(f[x])
            return f[x]
        def union(x, y):
            f[find(y)] = find(x)
        res = 0
        count = 0
        for x, y, w in sorted(conections, key=lambda x: x[2]):
            if find(x) != find(y):
                union(x, y)
                res += w
                count += 1
                if count == N - 1:
                    return res
        return -1


    def minimumCost(self, N: int, conections) -> int:
        conections = sorted(conections, key=lambda x: x[2],reverse=True)
        res = 0
        count = 0
        visited = set()
        all_node = set(range(1, N+1))
        while visited != all_node and conections:
            tmp = conections.pop(-1)

            if tmp[0] in visited and tmp[1] in visited:
                continue
            count += 1
            res += tmp[2]
            visited.add(tmp[0])
            visited.add(tmp[1])
            if count == N - 1:
                return res
        #print(count)
        return -1



